array = np.array(flat_arr).reshape((100, 520))
# Load the image
img = Image.open("C:/Users/spear/Downloads/grasslands (7).png").convert("RGB")
img = img.resize((len(array[0]), len(array)))  # match array dimensions if needed
    
    # Convert to numpy arrays
arr = np.array(array, dtype=np.int32)
pixels = np.array(img)

    # Define what "pink" means (tune tolerance as needed)
pink_lower = np.array([180, 0, 100])   # lower RGB bound
pink_upper = np.array([255, 120, 255]) # upper RGB bound
    
    # Create a mask for pink pixels
pink_mask = np.all((pixels >= pink_lower) & (pixels <= pink_upper), axis=-1)
    
    # Apply modification
arr[pink_mask] = 10

filename = "C:/Users/spear/OneDrive - purdue.edu/College Documents/Fall 25/CS407/CS407-Project/data/Grasslands/" + "StageArray.txt"

with open(filename, 'w') as outputFile:
    for row in arr:
        # Convert each element in the row to a string and join them with a space
        # You can use other delimiters like ',' or '\t' if preferred
        row_string = ','.join(map(str, row))
        # Write the row string to the file, followed by a newline character
        outputFile.write(row_string + ',\n')